import React, { memo, useRef, useState, useEffect } from 'react';
import { CSSTransition } from 'react-transition-group';
import { Container,  LoginWrapper  }  from '../style'

function LoginPhone() {
    const [show, setShow] = useState(false);

    useEffect(() => {
        setShow(true);
    }, []);


    return (
        <CSSTransition
            in={show}
            timeout={300}
            appear={true}
            classNames="fly"
            unmountOnExit
        >
            <Container>
                    <LoginWrapper>
                    手机号登录
                    </LoginWrapper>

            </Container>
        </CSSTransition>
    )
}

export default memo(LoginPhone)
